import React from "react";
import UserList from "../Components/UserList";

const Users = () => {
  const Users = [
    {
      id: "u1",
      name: "Sumeet Jumde",
      image:
        "data:image/jpeg;base64,",
      places: 1,
    },
  ];
  return (
    <>
      Working
      <UserList items={Users} />
    </>
  );
};

export default Users;
